 | \t\t\r\n      \r\n  Scenario Outline: Find all existing mechanics with contract in force when there are some mechanics with contract in force\r\n   Given the following relation of mechanics with a contract in force\r\n      | dni  \t| name  | surname   | type | group | state | startDate |\r\n      | DNI-7 | Name-7| Surname-7 | PERMANENT | I | IN_FORCE | 1-01-2022 |\r\n      |DNI-8 | Name-8| Surname-8| PERMANENT | I |IN_FORCE |1-01-2022 |\r\n      |  DNI-9 | Name-9| Surname-9 | PERMANENT | I |IN_FORCE |1-01-2022 |\r\n    And the following relation of mechanics with a contract terminated\r\n      | dni  \t| name  | surname   | type | group | state | startDate |\r\n      | DNI-10 | Name-10| Surname-10 | PERMANENT | II |TERMINATED |1-01-2022 |\r\n      | DNI-11 | Name-11| Surname-11 |PERMANENT | II |TERMINATED|1-01-2022 |\r\n          When we read all mechanics with contract in force\r\n    Then we get the following list of mechanics \r\n      | mechanic\t\t\t\t\t\t\t\t |\r\n      | DNI-7,Name-7,Surname-7 |\r\n      | DNI-8,Name-8,Surname-8 |\r\n      | DNI-9,Name-9,Surname-9 | \t            ","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/omenp/Desktop/3rd%20grade/RI/Prácticas/P8%20JPA/ws8/acceptance_tests.cws_extension1/src/test/resources/uo/ri/cws/application/service/mechanic/FindWithContractInForce.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Find all mechanics with contract in force","description":"  As a Manager\n  I need to know current mechanics ","children":[{"scenario":{"location":{"line":5,"column":3},"tags":[],"keyword":"Scenario","name":"Find all existing mechanics with contract in force when there is no mechanic","description":"","steps":[{"location":{"line":6,"column":5},"keyword":"When ","text":"we read all mechanics with contract in force","id":"46fab940-7c7a-4fb6-9bf3-896f208f546e"},{"location":{"line":7,"column":3},"keyword":"Then ","text":"List ests.cws_extension1/src/test/resources/uo/ri/cws/application/service/payroll/FindPayrolls.feature","data":"Feature: Find payrolls all scenarios\r\n  As a manager I want to find information about payrolls\r\n\r\n\t@getAllPayrolls\r\n\t\tScenario: Find payrolls when there is none \r\n    \tWhen I search payrolls\r\n    \tThen Result is empty\r\n    \t\r\n\t\tScenario: Find payrolls when there are some \r\n\t\tGiven the following relation of mechanics with a contract\r\n      | dni  \t| name  | surname   | type | group | state |\r\n      | DNI-1 | Name-1| Surname-1 | PERMANENT | I | IN_FORCE |\r\n      | DNI-2 | Name-2| Surname-2 | PERMANENT | I | IN_FORCE |\r\n      | DNI-3 | Name-3| Surname-3 | PERMANENT | I | IN_FORCE |\r\n    And several payrolls for all the contracts     \r\n  \tWhen I search payrolls\r\n   \tThen All payrolls summary are returned\r\n    \t\r\n  @getPayrollDetails\r\n  \t@IllegalArgumentException\r\n\t  Scenario: Try to find a payroll with null id\r\n\t  \tWhen I try to find payroll with null argument\r\n  \t  Then argument is rejected with an explaining message\r\n\r\n\t  Scenario Outline: Try to find a payroll with invalid id\r\n  \t  When I try to find payroll with <id> argument\r\n    \tThen argument is rejected with an explaining message\r\n \t\tExamples:\r\n \t\t|  id  |\r\n \t\t| \"\"   |\r\n \t\t| \"   \"|\r\n\t  \r\n\t\t@PositiveCases\r\n\t\tScenario: Find a non existent payroll \r\n    \tWhen I find a payroll with a non existent id\r\n    \tThen Returns empty\r\n    \t\r\n\t\tScenario: Find an existent payroll \r\n     Given the following mechanic with a contract in force\r\n      | dni  \t| name  | surname   | type | group | state | startDate |\r\n      | DNI-1 | Name-1| Surname-1 | PERMANENT | I | IN_FORCE | 1-5-2022|\r\n  \tAnd One payroll for this contract this month \r\n   \tWhen I search a payroll by id\r\n   \tThen This payroll is returned\r\n    \t\r\n\t@getAllPayrollsForMechanic\r\n  \t@IllegalArgumentException\r\n\t  Scenario:
